import React, { useState } from 'react';
import './DashboardPage.css';

const DashboardPage = () => {
  const [selectedPlace, setSelectedPlace] = useState('');
  const [places] = useState([
    {
      id: 1,
      name: 'Puerto Escondido',
      location: 'Oaxaca, México',
      extension: '5 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
    {
      id: 2,
      name: 'Zipolite',
      location: 'Oaxaca, México',
      extension: '3 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
    {
      id: 3,
      name: 'Puerto Ángel',
      location: 'Oaxaca, México',
      extension: '2 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
    {
      id: 4,
      name: 'Huatulco',
      location: 'Oaxaca, México',
      extension: '10 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
    {
      id: 5,
      name: 'Bahías de Huatulco',
      location: 'Oaxaca, México',
      extension: '15 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
  ]);

  const handlePlaceSelect = (placeId) => {
    setSelectedPlace(placeId);
  };

  const handleRatingChange = (aspect, value) => {
    setSelectedPlace(prevPlace => ({
      ...prevPlace,
      ratings: {
        ...prevPlace.ratings,
        [aspect]: value,
      },
    }));
  };

  const handleSubmitRating = () => {
    // Aquí puedes enviar la calificación de la playa a tu backend o realizar otras acciones necesarias
    console.log(`Calificación para la playa ${selectedPlace} enviada:`, places.find(place => place.id === selectedPlace).ratings);
    // Puedes limpiar el estado de la playa seleccionada después de enviar la calificación si es necesario
    setSelectedPlace('');
  };

  const renderPlaceOptions = () => (
    <select value={selectedPlace} onChange={(e) => handlePlaceSelect(parseInt(e.target.value))}>
      <option value="">Selecciona una playa</option>
      {places.map(place => (
        <option key={place.id} value={place.id}>{place.name}</option>
      ))}
    </select>
  );

  const renderPlaceInfo = () => {
    if (!selectedPlace) return null;

    const place = places.find(place => place.id === selectedPlace);

    return (
      <div className="place-info">
        <h2>{place.name}</h2>
        <p><strong>Ubicación:</strong> {place.location}</p>
        <p><strong>Extensión:</strong> {place.extension}</p>
        <p><strong>Tipo:</strong> {place.type}</p>
        <div className="ratings">
          <p>
            Limpieza:
            <input
              type="number"
              min="1"
              max="5"
              value={place.ratings.cleanliness}
              onChange={(e) => handleRatingChange('cleanliness', parseInt(e.target.value))}
            />
          </p>
          <p>
            Belleza:
            <input
              type="number"
              min="1"
              max="5"
              value={place.ratings.beauty}
              onChange={(e) => handleRatingChange('beauty', parseInt(e.target.value))}
            />
          </p>
          <p>
            Accesibilidad:
            <input
              type="number"
              min="1"
              max="5"
              value={place.ratings.accessibility}
              onChange={(e) => handleRatingChange('accessibility', parseInt(e.target.value))}
            />
          </p>
          <p>
            Seguridad:
            <input
              type="number"
              min="1"
              max="5"
              value={place.ratings.safety}
              onChange={(e) => handleRatingChange('safety', parseInt(e.target.value))}
            />
          </p>
        </div>
        <button onClick={handleSubmitRating}>Aceptar</button>
      </div>
    );
  };

  return (
    <div className="dashboard-container">
      <div className="background-image"></div>
      <div className="form-container wrapper">
        <h1>Calificar Playas de Oaxaca, México</h1>
        {renderPlaceOptions()}
        {renderPlaceInfo()}
      </div>
    </div>
  );
};

export default DashboardPage;
